INSERT INTO `Animal` VALUES (1,1,'Clemente Lodin','Aves','2019-04-14 02:03:11','2020-03-09 11:38:33',9,1,'The bald eagle is the second largest bird of prey in North America after the Californian condor. It is named after its conspicuous white (but fully-feathered) head.'),(2,2,'Shastaa','Mammalia','2019-10-18 04:54:26','2020-03-22 23:23:24',198,1,'The cougar is known by many names including panther, puma, and mountain lion. Cougars have the largest range of any mammals in the Western Hemisphere and live in deserts, mountains, and rainforests.'),(3,3,'Loleta Shillinglaw','Amphibia','2020-01-11 16:11:55','2020-03-27 16:38:30',1,1,'These animals protect themselves from predators with unique, poisonous skin secretions. You can only find these beautiful, endangered creatures in parts of Panama.'),(4,4,'Derek Boarer','Amphibia','2019-11-11 01:46:25','2020-03-17 10:41:40',1,0,'Historically, the Houston toad ranged across central and east Texas, but a drought and urban expansion in the 1960s saw the population decline. Today, there are only four small habitat areas left.'),(5,5,'Kellia Rodrigues','Aves','2019-05-07 00:44:31','2020-03-02 08:27:11',1,0,'The kookaburra is a member of the kingfisher family from Australia, though they inhabit dry forests where their diet is far morel likely to be mice or insects than fish. Their call sounds like cascades of loud enthusiastic laughter.'),(6,6,'Janeta Spottiswood','Mammalia','2020-03-10 06:07:36','2020-04-04 09:58:27',49,1,'These beautiful animals are named for their spots, which resemble clouds. They have a very secretive nature and are rarely seen in the wild.'),(7,7,'Livvie Josselsohn','Reptilia','2020-02-03 01:45:07','2020-03-02 05:59:22',2,0,'These snakes vary in color from gray to brown, and they get their name from the blue-black color of the inside of their mouth, which they display when threatened.'),(8,8,'Blake Pourvoieur','Mammalia','2019-05-05 00:32:51','2020-03-24 16:25:49',520,1,'This rare animal is found only in the most remote rainforests of central Africa. They have stripes like a zebra but are much more closely related to giraffes. It is almost impossible to observe an okapi in the wild.');
