INSERT INTO `Exhibit` VALUES (1,3,2,'Kangaroo, eastern','Savannas','That\'s no fanny pack on their stomach, its a pouch for carrying baby joey\'s! These Kangaroos are often seen in small packs grazing or larger groups napping.','https://source.unsplash.com/2f33ykzzPCU/256x256'),(2,7,0,'Mexican beaded lizard','Dry Forest','This specie of lizard is one of the two venomous species of beaded lizards. They primarily diet on bird and reptile eggs.','https://source.unsplash.com/FswN1Y06Gec/256x170'),(3,6,0,'Jabiru stork','River','These massive storks are over 4-5 ft in height with a wingspan of up to 9 ft!','https://source.unsplash.com/qr3YTbMioQw/256x256'),(4,3,0,'Bee-eater, carmine','Savannas','These little guys can be found in various regions of the world. Recognizable by their carmine color and blue-green head, they are an interesting little bird.','https://source.unsplash.com/E6foA0IkJ7E/256x256'),(5,2,0,'Bee-eater, nubiann','Savannas','Like the name suggests, these little birds feed on bees and other insects. You better bee careful if you\'re an insect within snatching distance of one of these little birds.','https://source.unsplash.com/wyJ5XVYH4l4/256x256'),(6,3,0,'Blackbird, red-winged','Wetland','These blackbirds get their name from the distinct red spot on males shoulders. ','https://source.unsplash.com/_YdpuXpvH8c/256x170'),(7,6,0,'Meerkat, red','Forest','These little mongooses sure love to dig! In this exhibit be sure to keep an eye out for when they peek from and leave their holes!','https://source.unsplash.com/c33t-15k_5A/256x256'),(8,7,0,'Racer, blue,black','Plains','Like hedgehogs, these snakes live in the savannas. Unlike hedgehogs, these lads have no legs.','https://source.unsplash.com/0TzztcEkSFo/256x149'),(9,2,0,'Tarantula','Savannas','These bad boys have 7 segmented legs, with retractable claws at the ends of their legs to grip surfaces. Surrounding these claws are hairs to better climb finer surfaces such as glass.','https://source.unsplash.com/mpC-nvRn3tA/256x170'),(10,6,0,'Pale-throated three-toed sloth','Tropical Forest','These long lounging lads lengthen their limbs to lurch for leaves. Solidary and securely suspended sleeping sixty-thousand seconds sunshine or stormy, the slow sloth slumbers.','https://source.unsplash.com/GTXvpZ2eTdA/256x144');
