INSERT INTO `Gift_Shop` VALUES (1,1,'Macaw Café','The perfect place to grab a quick bite as you enter the Zoo, Macaw Café offers a seasonal rotation of market salads and wraps, sandwiches, hamburgers, hot dogs, pizza, fries, and a variety of treats such as parfaits, cookies, trail mix, and fresh fruit.','https://s28164.pcdn.co/files/Macaw-Cafe_0222-1080x720.jpg','01368'),(2,7,'Cypress Circle Café','This Green Restaurant Certified conscientious café focuses on providing locally sourced, sustainable fares that are delicious and wholesome for the entire family.','https://s28164.pcdn.co/files/Cypress-Circle-Cafe-0008-2507-1080x720.jpg','14102'),(3,7,'Twiga Café','Imported straight from the houston zoo, come visit the Twiga’s spacious, cool dining room to snack on everything from hamburgers to salads to chicken tenders. Pizza, a variety of other kids’ options, and snacks like fresh fruit, cookies, trail mix, and mo','https://s28164.pcdn.co/files/Twiga-cafe-entrance-1080x720.jpg','90514'),(4,1,'Juanitas Fajitas','You asked and we listened! Juanitas Fajitas are finally here, come and get em\' while they\'re hot!','https://source.unsplash.com/NctysRJAuEs/256x192','02191');
