/*!50003 CREATE*/ /*!50017 DEFINER=`michael`@`%`*/ /*!50003 TRIGGER `Team10`.`Item_Purchase_BEFORE_INSERT` BEFORE INSERT ON `Item_Purchase` FOR EACH ROW
BEGIN
	DECLARE amount BIGINT;
    SET amount := (SELECT Stock_Count FROM `Team10`.`Items` WHERE Item_ID = NEW.Item_ID)
				  - NEW.Quantity;
	IF (amount < 0) THEN
		# throws an error and cancels the insertion
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'There is not enough in stock.';
    ELSE
		UPDATE `Team10`.`Items`
		SET
		`Stock_Count` = amount
		WHERE `Item_ID` = NEW.Item_ID;
    END IF;
END */;;
